		this.innocent02_btn.addEventListener("pressmove", ClickToDrag.bind(this));
		this.innocent03_btn.addEventListener("pressmove", ClickToDrag.bind(this));
		this.innocent04_btn.addEventListener("pressmove", ClickToDrag.bind(this));
		this.innocent05_btn.addEventListener("pressmove", ClickToDrag.bind(this));
